INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("2030/12/17 14:59:59", 0.0, 24, 4, 0.0, 110501, 24015, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 0.0, 1, 10021, 4, "カオリ（サマー）", "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("2030/12/17 14:59:59", 4.0, 24, 4, 0.0, 110501, 24016, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 0.0, 2, 10021, 1, "カオリ（サマー）", "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("2030/12/17 14:59:59", 0.0, 24, 4, 0.0, 110501, 24017, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 0.0, 3, 10021, 4, "カオリ（サマー）", "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("2030/12/17 14:59:59", 5.2, 24, 1, 0.0, 110501, 24018, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 0.0, 4, 10021, 2, "カオリ（サマー）", "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("2030/12/17 14:59:59", 4.2, 24, 5, 0.0, 110501, 24019, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 0.0, 5, 10021, 6, "カオリ（サマー）", "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("2030/12/17 14:59:59", 0.0, 24, 2, 0.0, 110501, 24020, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 0.0, 6, 10021, 2, "カオリ（サマー）", "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("2030/12/17 14:59:59", 6.4, 24, 1, 0.0, 110501, 24021, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 0.0, 7, 10021, 6, "カオリ（サマー）", "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("2030/12/17 14:59:59", 0.0, 24, 2, 0.0, 110501, 24022, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 0.0, 8, 10021, 2, "カオリ（サマー）", "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("2030/12/17 14:59:59", 10.08, 24, 6, 0.0, 110501, 24023, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 0.0, 9, 10021, 3, "カオリ（サマー）", "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("2030/12/17 14:59:59", 5.0, 24, 1, 0.0, 110501, 24024, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 0.0, 10, 10021, 2, "カオリ（サマー）", "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES ("2030/12/17 14:59:59", 0.0, 24, 2, 0.0, 110501, 24025, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 0.0, 11, 10021, 2, "カオリ（サマー）", "2019/07/31 12:00:00");
